import './App.css';
import Footer from './components/Footer';
import Header from './components/Header';
import Layout from './components/Layout';
import Main from './components/Main';
import Nav from './components/Nav';

function App() {
  return (
    <div className="App">
      <Layout>
        <Header/>
        <Nav/>
        <Main/>
        <Footer/>
      </Layout>
    </div>
  );
}

export default App;
